import React, { useEffect } from 'react'
import ReactPlayer from "react-player";
import ReactDOM from 'react-dom'

export default function BrowsePage() {
    // const [mute, setMute] = useState(true);


    return (
        <div>
            <div className="h-14 w-screen bg-black bg-opacity-100 pl-5 pt-2 flex items-center">
                <div className="text-red-600 text-2xl font-semibold hover:text-3xl transition-all duration-100"><a href="#"><h1>Netflix</h1></a></div>
                <div className="flex-grow ">
                    <ul className="flex text-white space-x-8 pl-6">
                        <a href="#"><li>Home</li></a>
                        <a href="#"><li>TV Shows</li></a>
                        <a href="#"><li>Movies</li></a>
                        <a href="#"><li>News & Popular</li></a>
                        <a href="#"><li>My List</li></a>
                        <a href="#"><li>Browse by Language</li></a>
                    </ul>
                </div>
                <div className="flex justify-end">
                    <ul className="flex text-white space-x-3 pl-5 pr-10">
                        <a href="#" className="hover:text-xl transition-all duration-200"><li>Search</li></a>
                        <a href="#" className="hover:text-xl transition-all duration-200"><li>Profile</li></a>
                    </ul>
                </div>
            </div>
            <div className="bg-amber-700 w-screen h-[30rem]">
                <ReactPlayer
                    url={'http://localhost:3000/Trailers/Transformer/5'}
                    playing={true}
                    width="100%"
                    height="100%"
                    autoPlay={true}
                    muted={true}
                    controls={false}
                />
            </div>
        </div>
    )
}
